import { useEffect, useState } from 'react';
import { useStore } from './store';
import { useGetTodos } from './useTodo';

function Sample1() {
  const { isLoading, data, executeCb } = useGetTodos();
  const {state, dispatch} = useStore();
  const [counter, setCounter] = useState(data);

  useEffect(() => {
    executeCb();
  }, [executeCb])

  useEffect(() => {
    console.log('state counter changed', state.count);
    setCounter(state.count);
  }, [state.count]);

  console.log('counter', counter, data, state);
  return (
    <>
      <div>{isLoading ? 'isLoading' : 'is not Loading'}</div>
      <div>Sample 1 - {counter}</div>
      <button onClick={() => dispatch({type: "increment", message:"Incremented"})}>+</button>
      <button onClick={() => dispatch({type: "decrement", message: "Decremented"})}>-</button>
      <button onClick={() => dispatch({type: "reset", message: "Reset"})}>Reset</button>
    </>
  );
}

export default Sample1;
